import React from "react";
import ".././output.css";
import HeaderText from "../componets/headertext";
function Aboutme(props) {
  return (
    <div className=" w-[42vw] h-[86vh] ml-[5vw] mt-[8.5vh] border border-white grid grid-rows-[3fr_1fr_3fr_1fr_4fr] ">
      <div className="border border-white">
        <div class="w-[656px] h-[149.59px] relative">
          <div class="w-[571.08px] h-[160.80px]">
            <span class="text-white text-[85px] font-semibold font-['Outfit'] leading-[74.80px]">
              SOFTWARE
            </span>
            <span class="text-white text-[68px] font-semibold font-['Outfit'] leading-[74.80px]">
              {" "}
            </span>
            <span class="text-[#914bf1] text-[74px] font-semibold font-['Outfit'] leading-[74.80px]">
              ENGINEER
            </span>
          </div>
        </div>
        {
          <HeaderText
            w="86.32vw"
            h="7.79vh"
            textsize="4.43vw"
            position="left"
            line1="SOFTWARE"
            line2="ENGINEER"
            lastColor="#914bf1"
          />
        }
      </div>
      <div className="border border-white"></div>
      <div className="border border-white"></div>
      <div className="border border-white"></div>
    </div>
  );
}

export default Aboutme;
